import { Text, View } from "react-native";
import { TextInput, Button } from "react-native-paper";
import { useState } from "react";
import { useForm, Controller } from 'react-hook-form';
import { styles } from "../assets/styles/styles";
import { validateEmail } from "../utils/helpers";
import axios from 'axios';
import { size } from "lodash";

export default function RegisterScreen({navigation}) {

    const { control, handleSubmit, formState: { errors }, reset, setValue } = useForm({
        defaultValues: {
          userName: '',
          email: '',
          confirmNewpassword: ''
        }
      });


    return (
        <View style={[styles.container]}>
            <Text style={{fontFamily:'Arial',fontSize:40,marginTop:10}}>Crea tu cuenta</Text>
            <Controller
                control={control}
                rules={{
                  required: true,
                }}
                render={({ field: { onChange, onBlur, value } }) => (
                <TextInput
                  style={styles.texinput}
                  activeOutlineColor="#0265FE"
                  outlineColor="#919191"
                  label="Usuario"
                  mode="outlined"
                  onBlur={onBlur}
                  onChangeText={onChange}
                  value={value}
                />
                )}
              name="name"
            />
            {errors.name && <Text style={{ color: 'red' }}>El Usuario es obligatorio</Text>}
            <Controller
                control={control}
                rules={{
                  required: true,
                }}
                render={({ field: { onChange, onBlur, value } }) => (
                <TextInput
                  style={styles.texinput}
                  activeOutlineColor="#0265FE"
                  outlineColor="#919191"
                  label="Correo Electronico"
                  mode="outlined"
                  left={<TextInput.Icon icon="account"/>}
                  onBlur={onBlur}
                  onChangeText={onChange}
                  value={value}
                />
                )}
              name="email"
            />
            {errors.email && <Text style={{ color: 'red' }}>El Usuario es obligatorio</Text>}
            <Controller
                control={control}
                rules={{
                  required: true,
                }}
                render={({ field: { onChange, onBlur, value } }) => (
                <TextInput
                  style={styles.texinput}
                  activeOutlineColor="#0265FE"
                  outlineColor="#919191"
                  label="Correo Electronico"
                  mode="outlined"
                  left={<TextInput.Icon icon="account"/>}
                  onBlur={onBlur}
                  onChangeText={onChange}
                  value={value}
                />
                )}
              name="userName"
            />
            {errors.userName && <Text style={{ color: 'red' }}>El Usuario es obligatorio</Text>}
            <Controller
                control={control}
                rules={{
                  required: true,
                }}
                render={({ field: { onChange, onBlur, value } }) => (
                <TextInput
                  style={styles.texinput}
                  activeOutlineColor="#0265FE"
                  outlineColor="#919191"
                  label="Correo Electronico"
                  mode="outlined"
                  left={<TextInput.Icon icon="key"/>}
                  right={<TextInput.Icon icon={showPass ? "eye-off":"eye"} onPress={()=>setShowPass(!showPass)}/>}
                  onBlur={onBlur}
                  onChangeText={onChange}
                  value={value}
                />
                )}
              name="password"
            />
            {errors.password && <Text style={{ color: 'red' }}>El Usuario es obligatorio</Text>}
            <TextInput
                style={styles.texinput}
                activeOutlineColor="#0265FE"
                outlineColor="#919191"
                label="Contraseña"
                mode="outlined"
                left={<TextInput.Icon icon="key"/>}
                right={<TextInput.Icon icon={showPass ? "eye-off":"eye"} onPress={()=>setShowPass(!showPass)}/>}
                onChangeText={(e) => onChange(e,"password")}
                secureTextEntry={!showPass}
                defaultValue={formDataRegister.password}
            />
            <TextInput
                style={styles.texinput}
                activeOutlineColor="#0265FE"
                outlineColor="#919191"
                label="Confirmacion"
                mode="outlined"
                left={<TextInput.Icon icon="key"/>}
                right={<TextInput.Icon icon={showPassConf ? "eye-off":"eye"} onPress={()=>setShowPassConf(!showPassConf)}/>}
                onChangeText={(e) => onChange(e,"confPassword")}
                secureTextEntry={!showPassConf}
                defaultValue={formDataRegister.confPassword}
            />
            <View style={[{ backgroundColor: "#fff", flexDirection: "row",marginTop:20 }]}>
            <Button
                style={{marginTop:20,marginEnd: 10}}
                icon="content-save"
                mode="contained"
                buttonColor="#0265FE"
                onPress={()=>{
                    //Se llama la funcion que realiza la validacion de los datos
                    // setRegisterUser()
                    
                }}
            >Registrarse</Button>
            <Button
                style={{marginTop:20}}
                textColor="#0265FE"
                onPress={()=>{
                    setTimeout(()=>{
                        navigation.navigate('Login')
                    },1000)
            }}
            >Volver</Button>
            </View>
            <Text style={{fontFamily:'Arial',fontSize:15,marginTop:20,color:'red'}}>{errorMess}</Text>
        </View>
    );
}
